import React from 'react';
import { Box, Container, Toolbar, Typography } from '@mui/material';
const Search = () => {
  return (
    <>
      <Toolbar></Toolbar>

      <Container sx={{ background: 'black', height: '100vh', pt: 5 }}>
        <Box>
          <Typography>Search </Typography>
        </Box>
      </Container>
      <Toolbar></Toolbar>
    </>
  );
};

export default Search;
